import React from "react";
import { ReactDOM } from "react";
import styles from'';

const Tender=()=>{

    return(
        <>
        <meta charSet="utf-8" />
        <link
          rel="stylesheet"
          href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css"
        />
        <title>Results</title>
        <style
          dangerouslySetInnerHTML={{
            __html:
              '

            .btn-grad 
{

    position: absolute;
    width: auto;
    height: 40px;
    font-size: auto;
    text-align: center;
    background: linear-gradient(90deg, #008ECB 0%, #005AE0 100%);
    border-radius: 3px;
    font-family: 'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;


}

.btn-grad:hover
{
    border:2px solid rgb(0, 75, 107);
    background: linear-gradient(90deg,#005AE0 0%, #008ECB 100%);


}


#scroll
{
    width:auto;
    border: 1px solid black;
    height: 500px;
    overflow: scroll;
    margin: 60px;
    margin-right: 110px;
    margin-top:20px;
    scroll-behavior: smooth;


}


th 
{
    border: 1px solid #D5D5D5;
    padding: 25px;  
    height: 80px;
    font-size: 16px;
    text-align: center;

}


td
{
    border: 1px solid #D5D5D5;
    text-align: center;
    padding: 25px;
    height: 60px;
    align-content: center;
}
  a 
  {
      text-decoration: none;
      display: inline-block;
      padding: 8px 16px;
  }

  a:hover {
      background-color: #ddd;
      color: black;
  }

  .previous {
      background-image: linear-gradient(to right, #E44D26 0%, #F16529 51%, #E44D26 100%);
      color: rgb(255, 255, 255);
      border-radius: 5px;
      width: 120px;
      text-align: center;
      font-weight: bolder;
  }

  .next {
      background-image: linear-gradient(to right, #E44D26 0%, #F16529 51%, #E44D26 100%);
      color: rgb(255, 255, 255);
      border-radius: 5px;
      width: 120px;
      text-align: center;
      font-weight: bolder;
  }

  .round {
      border-radius: 50%;
  }


@media only screen and (max-width: 1024px) 
{
        .column 
        {
            width: 100%;
            margin-left: 250px;
        }
        .abc
        {
          margin-right: 0px;
        }
}

/*-------------------------------------ACCORDIAN---------------------------------------------------*/
@import url('https://netdna.bootstrapcdn.com/font-awesome/4.0.3/css/font-awesome.css');
.pcs:after {
content: " pcs";
}
.cur:before {
content: "$";
}
.per:after {
content: "%";
}
* {
box-sizing: border-box;
}
body {
padding: 0.2em 2em;
}
table {
width: 100%;
table-layout: fixed;

}
table th {
text-align: center;
width: 120px;
border-bottom: 1px solid #ccc;
}
table th, table td {
padding: 0.4em;
}
table.fold-table > tbody > tr.view td, table.fold-table > tbody > tr.view th {
cursor: pointer;
}
table.fold-table > tbody > tr.view td:first-child, table.fold-table > tbody > tr.view th:first-child {
position: relative;
padding-left: 20px;
